uint32_t Length;
const uint8_t *SoundPt;
uint8_t songEnded = 0;
void SoundTask(void){
	if(Length) {
		DAC_Out(*SoundPt/4); //6 bit dac divide by 2^2
		SoundPt++;
		Length--;
	} else {
		NVIC_DIS0_R = 1<<19;
		songEnded =1;
	}
}
	
void Sound_Init(void){
// write this
   Length =0;
	 DAC_Init();
	 Timer0_Init(&SoundTask,80000000/11000); //11 KHz
	
};
void Sound_Play(const uint8_t *pt, uint32_t count){
// write this
	Length = count;
	SoundPt = pt;
	NVIC_EN0_R = 1<<19;
};

void Sound_Loop(void){
	if(songEnded == 1){
		songEnded = 0;
		Sound_TitleScreen();
	}
}

void Sound_TitleScreen(void){
// write this
	Sound_Play(TitleScreen, 124518);
};



void Sound_Highpitch(void){
// write this
	Sound_Play(highpitch, 1802);
};

